<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Code Help Contact Us!</title>
</head>

<body>
    <header>
        <h1>Welcome to CodeHelp!</h1>
        <h2>Contact Us Form</h2>
    </header>

    <form action="https://www.thecodehelp.in/">
        <fieldset>
            <legend>Registration Form</legend>
            <label for="name">Name: </label>
            <input type="text" name="name" id="name" placeholder="Enter Your Name" />
            <br />
            <label for="email:">Email: </label>
            <input type="email" name="email" id="email" placeholder="Enter Your Email" />
            <br />
            <label for="contact">Contact: </label>
            <input type="number" name="contact" id="contact" placeholder="Enter Mobile Number" />
            <br />
            <label for="contact">Gender: </label>
            <select name="gender" id="gender">
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="no">Prefer Not to say</option>
            </select>
            <br />
            <label for="dob">Date:</label>
            <input type="date" name="dob" id="dob" />
            <br />
            <span>Rating:</span>
            <input type="radio" name="rating" id="rating1" value="1" />
            <label for="rating1">1</label>
            <input type="radio" name="rating" id="rating2" value="2" />
            <label for="rating2">2</label>
            <input type="radio" name="rating" id="rating3" value="3" />
            <label for="rating3">3</label>
            <input type="radio" name="rating" id="rating4" value="4" />
            <label for="rating4">4</label>
            <input type="radio" name="rating" id="rating5" value="5" />
            <label for="rating5">5</label>
            <br />
            <label for="msg">Enter Your Message:</label><br>
            <textarea name="msg" id="msg" rows="10" cols="30" placeholder="Write your message!"></textarea>
            <br />
            <input type="submit" name="submit" id="submit" value="Submit" />
            <input type="reset" name="reset" id="reset" value="Reset" />
        </fieldset>
    </form>
